import React, { useState } from 'react'

function InteractiveWindow() {
    const [length, setLength] = useState(0)
  return (
    <div className='custom-shadow flex justify-between items-center bg-slate-400 text-yellow-200 p-4 rounded-2xl'>
        <div className="flex flex-col">
            <span className="text-lg text-white">Password Length</span>
            <span>{length}</span>
        </div>
    </div>
  )
}

export default InteractiveWindow
